              </th>
              <th>
                Student
              </th>
            </tr>
          </thead>
          <tbody>
            {this.state.courseList.map((value, index) => {
              return (
                <tr key={index}>
                  <td>{value.Id}</td>
                  <td>{value.feee}</td>
                  <td>{value.trainer}</td>
                  <td>{value.student}</td>
                </tr>
              )
            })}
          </tbody>
        </table>
        
      </div>
    )
  }
}
